import React from 'react'
import Person from './Person'

export default function List() {


    function NameList() {
        const persons = [
            {
                id: 1,
                name: 'Hilian',
                age: 1,
                skill: 'FullStack'
            },
            {
                id: 2,
                name: 'Daniel',
                age: 26,
                skill: 'FullStack React'
            },
            {
                id: 3,
                name: 'Jose',
                age: 25,
                skill: 'FullStack Angular'
            }

        ]
    const personsList = persons.map(person => <Person person={person} ></Person>)
        return <div>{personsList}</div>
    }

    return (
        <div>

            {
                NameList()
            }

        </div>
    )
}
